import './App.css';

import React, { Component } from 'react'
import Navbar from './contaner/Navbar';
import News from './contaner/News';

export class App extends Component {
  render() {
    return (
      <div>
        <Navbar/>
        <News sizeofpage = {5} country="in" category = 'health'/>
      </div>
    )
  }
}

export default App
